import { BrowserRouter, Routes, Route, Redirect, Navigate } from "react-router-dom";
import React, { useEffect } from 'react'

export default function Logout(props) {
    useEffect(()=>{
        props.isAuthFunc(false);
    },[])
    return <Navigate to="/logi"/>
}
